import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { deleteUser, showUser } from "../features/userDetailSlice";
import { Box, Paper, Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Button, Typography } from "@mui/material";

const Read = () => {
  const dispatch = useDispatch();
  const { users, loading } = useSelector((state) => state.app);

  React.useEffect(() => {
    dispatch(showUser());
  }, []);

  return (
    <Box mt={3} display="flex" justifyContent="center">
      <Box maxWidth="70%">
        <Typography variant="h4" align="center" fontWeight="bold" color="primary">
          All Users List
        </Typography>
        <TableContainer component={Paper} elevation={3}>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Name</TableCell>
                <TableCell>Email</TableCell>
                <TableCell>Age</TableCell>
                <TableCell>Gender</TableCell>
                <TableCell>Action</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {users.map((ele) => (
                <TableRow key={ele.id}>
                  <TableCell>{ele.name}</TableCell>
                  <TableCell>{ele.email}</TableCell>
                  <TableCell>{ele.age}</TableCell>
                  <TableCell>{ele.gender}</TableCell>
                  <TableCell>
                    <Button onClick={() => dispatch(deleteUser(ele.id))} variant="contained" color="secondary">
                      Delete
                    </Button>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
      </Box>
    </Box>
  );
};

export default Read;
